import express, { request, response } from 'express';
const mailchimpClient = require("@mailchimp/mailchimp_transactional")
  (process.env.MAILCHIMP_API_KEY);

var failed_emails: any[];
var sucseeded_emails: any[];

const app = express();

app.use(express.urlencoded({extended: true}));
app.use(express.json());

const port = process.env.PORT || 5000;
app.get('/', (req, res) => {
  res.send('My first node project');
});

app.post('/mail_send_api', (req, res) => {
  const run = async () => {
    const api_res = await mailchimpClient.messages.send({
      message : {
        "html": req.body.messageBody,
        "from_email": "nihaldewangan487@gmail.com",
        "to": req.body.receiver,
        "attachments": [
          {
            "type": "application/pdf",
            "name": "Test PDF",
            "content": ""
          }
        ]
      }
    })
    return api_res;
  }
  run().then((mc_response) => {
    Array.from(mc_response).forEach(async (elem: any)=> {
      if (elem.status === "rejected" || elem.status === "invalid") failed_emails.unshift(elem)
      else sucseeded_emails.push(elem)
  })
  // send the response
  res.status(200).jsonp({
      status: 200,
      message: `${sucseeded_emails.length} Sent, ${failed_emails.length} failed.`,
      data: {
          success: sucseeded_emails,
          failure: failed_emails
      }
  })
  });
});

app.listen(port, () => {
  return console.log(`server is listening on ${port}`);
});